import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const HeroContainer = styled.section`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  background: ${props => props.theme.colors.gradient.background};
  overflow: hidden;
`;

const HeroBackground = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-image: url('https://images.unsplash.com/photo-1515562141207-7a88fb7ce338?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80');
  background-size: cover;
  background-position: center;
  opacity: 0.3;
  z-index: 1;
`;

const HeroOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: linear-gradient(135deg, rgba(0, 0, 0, 0.7) 0%, rgba(26, 26, 26, 0.5) 100%);
  z-index: 2;
`;

const HeroContent = styled.div`
  text-align: center;
  z-index: 3;
  position: relative;
  max-width: 1000px;
  padding: 0 20px;
`;

const HeroTitle = styled(motion.h1)`
  font-size: clamp(4rem, 8vw, 8rem);
  font-weight: 100;
  letter-spacing: 12px;
  margin-bottom: 30px;
  font-family: ${props => props.theme.fonts.primary};
  background: ${props => props.theme.colors.gradient.elegantGold};
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  text-shadow: 0 0 30px rgba(212, 175, 55, 0.3);
  
  @media (max-width: 768px) {
    letter-spacing: 6px;
  }
`;

const HeroSubtitle = styled(motion.p)`
  font-size: 1.4rem;
  color: rgba(255, 255, 255, 0.9);
  font-weight: 300;
  letter-spacing: 3px;
  margin-bottom: 50px;
  text-shadow: 0 2px 10px rgba(0, 0, 0, 0.5);
  
  @media (max-width: 768px) {
    font-size: 1.2rem;
    letter-spacing: 2px;
  }
`;

const CTAButton = styled(motion.button)`
  padding: 18px 40px;
  background: ${props => props.theme.colors.gradient.goldSilver};
  color: #000;
  border: none;
  font-size: 1.1rem;
  font-weight: 400;
  letter-spacing: 2px;
  cursor: pointer;
  transition: all 0.4s ease;
  position: relative;
  overflow: hidden;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: -100%;
    width: 100%;
    height: 100%;
    background: ${props => props.theme.colors.gradient.silverGold};
    transition: left 0.5s ease;
    z-index: -1;
  }
  
  &:hover::before {
    left: 0;
  }
  
  &:hover {
    transform: translateY(-3px);
    box-shadow: 0 15px 35px rgba(212, 175, 55, 0.4);
  }
  
  @media (max-width: 768px) {
    padding: 15px 30px;
    font-size: 1rem;
  }
`;

const ScrollIndicator = styled(motion.div)`
  position: absolute;
  bottom: 30px;
  left: 50%;
  transform: translateX(-50%);
  display: flex;
  flex-direction: column;
  align-items: center;
  color: rgba(255, 255, 255, 0.7);
  font-size: 0.9rem;
  letter-spacing: 1px;
`;

const ScrollArrow = styled(motion.div)`
  width: 2px;
  height: 30px;
  background: ${props => props.theme.colors.gradient.goldSilver};
  margin-top: 10px;
  border-radius: 1px;
`;

const FloatingElements = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  pointer-events: none;
  z-index: 2;
`;

const FloatingShape = styled(motion.div)`
  position: absolute;
  background: ${props => props.theme.colors.gradient.goldSilver};
  opacity: 0.1;
  border-radius: 50%;
`;

const Hero = () => {
  return (
    <HeroContainer>
      <HeroBackground />
      <HeroOverlay />
      
      <FloatingElements>
        <FloatingShape
          style={{ width: '150px', height: '150px', top: '15%', left: '10%' }}
          animate={{
            y: [0, -30, 0],
            x: [0, 20, 0],
            rotate: [0, 180, 360],
          }}
          transition={{
            duration: 8,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        <FloatingShape
          style={{ width: '100px', height: '100px', top: '25%', right: '15%' }}
          animate={{
            y: [0, 25, 0],
            x: [0, -25, 0],
          }}
          transition={{
            duration: 6,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        <FloatingShape
          style={{ width: '80px', height: '80px', bottom: '20%', left: '20%' }}
          animate={{
            y: [0, -20, 0],
            rotate: [0, -180, -360],
          }}
          transition={{
            duration: 10,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
      </FloatingElements>

      <HeroContent>
        <HeroTitle
          initial={{ opacity: 0, y: 100 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1.2, delay: 0.5 }}
        >
          LUXE
        </HeroTitle>
        
        <HeroSubtitle
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.8 }}
        >
          TIMELESS ELEGANCE IN EVERY PIECE
        </HeroSubtitle>
        
        <CTAButton
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 1.2 }}
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          EXPLORE COLLECTION
        </CTAButton>
      </HeroContent>

      <ScrollIndicator
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1, delay: 2 }}
      >
        SCROLL
        <ScrollArrow
          animate={{ scaleY: [1, 1.5, 1] }}
          transition={{ duration: 2, repeat: Infinity }}
        />
      </ScrollIndicator>
    </HeroContainer>
  );
};

export default Hero;
